import Button from "./controls/Button";
import {insertStudentRecords} from '../services/studentRecordService';

export default function Submit(props){

    const handleSubmit = e => {
        e.preventDefault()

        insertStudentRecords(props.values);
        //restForm();
    }

    return(
        <div>
            <Button 
                text = "Submit" 
                type="submit" 
                onClick= {handleSubmit} />
        </div>
    )
}
